import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css';
import Sdata from './Sdata';

// console.log(Sdata[0].sname);

ReactDOM.render(
  <>
  <h1 className='heading_style'>List Of Top 5 Netflix Series in 2023</h1>
    <Card
      imgsrc={Sdata[0].imgscr}
      title = {Sdata[0].title}
      sname={Sdata[0].title}
      link={Sdata[0].title}
    />

    <Card 
      imgsrc="https://wallpapercave.com/dwp1x/wp6754493.jpg"
      title = "A original Netflix series"
      sname="EXTRA CURRICULAR"
      link="https://www.netflix.com/in/title/80990668?source=35"
    />

    <Card
      imgsrc="https://wallpapercave.com/dwp1x/wp11827144.png"
      title = "A original Netflix series"
      sname="STRANGER THINGS"
      link="https://www.netflix.com/in/title/80990668?source=35"
    />
  </>,
  document.getElementById('root')
);
